import React from "react";
import { FileUploader } from "carbon-components-react";

const Evi = ["3k", "3.2k", "5k", "Switch"];
const ZZ = ["EMS", "ESIO", "PRT"];

const UpZZ = ZZ.map(function (a) {
  return (
    <span style={{ width: "150px", marginLeft: "10px" }}>
      <label>{a}</label>
      <FileUploader
        accept={[".jpg", ".png", ".txt", ".zip"]}
        buttonKind="secondary"
        buttonLabel="Add files"
        filenameStatus="edit"
        iconDescription="Clear file"
        // labelDescription="only .jpg files at 500mb or less"
        // labelTitle="Upload"
      />{" "}
    </span>
  );
});

const UpF = Evi.map(function (a) {
  return (
    <div style={{ width: "150px", marginLeft: "10px" }}>
      <label>{a}</label>
      <FileUploader
        accept={[".jpg", ".png", ".txt", ".zip"]}
        buttonKind="secondary"
        buttonLabel="Add files"
        filenameStatus="edit"
        iconDescription="Clear file"
        // labelDescription="only .jpg files at 500mb or less"
        // labelTitle="Upload"
      />{" "}
      <br />
      <br />
    </div>
  );
});
function Upfile(prop) {
  return (
    <div>
      <label>{UpF}</label>
      <h1>ZZ</h1>
      <hr />
      <div style={{ display: "flex", margin: "0 10px" }}>
        <label>{UpZZ}</label>
      </div>
    </div>
  );
}
export default Upfile;
